function titleCase(str) {
    return str.split("_")
        .map(e => e[0].toUpperCase() + e.substring(1))
        .join(" ");
}

function parse() {
    const json = JSON.parse(str)
    return json.map((e, i) => ({
        unique_id: i + 1,
        label: titleCase(e.name),
        image_url: 'https://mc.nerothe.com/' + e.url.slice(5, -2)
    }))
}


